import React from "react";
// import AppLayout from "../../components/layout/AppLayout";
import TransitionLayout from "../../components/layout/TransitionLayout";
import BasicPageTitle from '../../components/layout/pagetitle/BasicPageTitle';  
import BasicForm from "../../components/form/BasicForm";
import BasicTabs from "../../components/tools/BasicTabs";
const MaterialPage = (): JSX.Element => {    

  const [focus, setFocus] = React.useState('form');

  const handleChangeFocus:any = (target:string) => { 
    setFocus(target);
    return;
  }

  const tabArray = [
    {title:"FORM", key:'form'} 
  ]
  return ( 
    <>
      <BasicPageTitle title="UI/UX" description="UI/UX 페이지 작업예정" />   
      <TransitionLayout title="UI/US" requiredLogin={true}>  

        <h3>Form</h3>  
        <BasicTabs tabArray={tabArray} focus={focus} handleChangeFocus={handleChangeFocus}/>   
          <BasicForm/> 

      </TransitionLayout> 
    </>
  );
};


export default MaterialPage;
